import Vue from 'vue';
import { createRouter, createWebHistory } from 'vue-router';

// console.log(VueRouter)

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "loginView",
    component: () => import("@/views/auth/loginView.vue")
  },
];

const router = createRouter({
  mode: 'history',
  history: createWebHistory(),
  routes,
});

export default router;
